import Categories from "./Components/Categories";
import Header from "./Components/Header";
import Slider from "./Components/Slider";
import "./Css.scss";
function App() {
  return (
    <div>
      <Header />
      <Slider />
      <Categories />
    </div>
  );
}

export default App;
